INSERT INTO `product` (`ProductID`, `CategoryID`, `ProductName`, `Brand`, `Weight`, `Description`, `Stock`, `Date`, `image1`, `image2`, `Price`) VALUES
(9, 4, 'Chop Suey Noodle', 'Lucky Boat ', 100, 'In 1421, the largest fleet the world had ever seen set sail from China operating under a single order from their emperor Zhu Di: ?To proceed all the way to the end of the world?. Lucky Boat is inspired by this magnificent voyage that discovered the world and honours its brave warriors, navigators and the Chinese Emperor?s quest to find and bring the best to the world.', 10, '2018-03-15', , , 18);
INSERT INTO `product` (`ProductID`, `CategoryID`, `ProductName`, `Brand`, `Weight`, `Description`, `Stock`, `Date`, `image1`, `image2`, `Price`) VALUES
(11, 1, 'China Tsing Tao Beer', 'Tsing Tao', 330, 'Tsingtao Beer has a pleasant aroma and a well-balanced taste. It has high-malty flavor and well-hopped character. Tsingtao is produced with spring water from Laoshan, a mountain area famous throughout China for the purity of its water.', 50, '2018-03-15', , , 2);
INSERT INTO `product` (`ProductID`, `CategoryID`, `ProductName`, `Brand`, `Weight`, `Description`, `Stock`, `Date`, `image1`, `image2`, `Price`) VALUES
(12, 3, 'Maling Luncheon Meat', 'Maling ', 340, 'Ma Ling Premium Luncheon Meat comes in canned form with pork and ham contents. This is ideal for a quick and easy lunch and is very popular in Philippines. This is a high quality, pre-cooked meat product with absolutely no starch or MSG.', 53, '2018-03-16', , , 2);
INSERT INTO `product` (`ProductID`, `CategoryID`, `ProductName`, `Brand`, `Weight`, `Description`, `Stock`, `Date`, `image1`, `image2`, `Price`) VALUES
(13, 4, 'KSF Braised Beef Bowl Noodle', 'KSF', 23, 'he Braised Beef Bowl Noodles by KSF brand (Kang Shi Fu or Master Kong) is a delicious instant noodles product of Chinese origin. This is artificial beef flavoured and can make a tasty meal.', 23, '2018-05-02', , , 12);
INSERT INTO `product` (`ProductID`, `CategoryID`, `ProductName`, `Brand`, `Weight`, `Description`, `Stock`, `Date`, `image1`, `image2`, `Price`) VALUES
(14, 1, 'KSF Green Tea 2L', 'KSF', 2, 'Green tea is a type of herbal beverage originated in China. To prepare green tea, Camellia Sinensis leaves (tea leaves) are used after drying and oxidization processes. This Master Kong (KSF) variety of Green tea comes in a big 2 litre bottle and has ingredients such as honey, sugar and food additives apart from green tea extract.', 40, '2018-05-02', , , 3);
INSERT INTO `product` (`ProductID`, `CategoryID`, `ProductName`, `Brand`, `Weight`, `Description`, `Stock`, `Date`, `image1`, `image2`, `Price`) VALUES
(15, 1, 'KSF Ice Red Tea 500ml', 'KSF', 500, 'KSF Ice Red Tea is one of the most popular daily drink in China. It\'s mellow red tea flavour and cool lemon flavour is the reason why it\'s so popular, especially when served chilled', 100, '2018-05-02', , , 2);
INSERT INTO `product` (`ProductID`, `CategoryID`, `ProductName`, `Brand`, `Weight`, `Description`, `Stock`, `Date`, `image1`, `image2`, `Price`) VALUES
(16, 1, 'Honey Pomelo Drink', 'KSF', 500, 'Product Overview KSFâ??s Honey & Pomelo based Juice Drink in 500ml bottles. Pomelo is a citrus fruit which looks like grapefruit, and thus this drink is sometimes mistakenly called Honey Grapefruit drink. The Pomelo is widely found in South and Southeast Asian countries. The KSF drink is great with its sweet and tangy flavour and refreshing aroma.', 30, '2018-05-01', , , 2);
INSERT INTO `product` (`ProductID`, `CategoryID`, `ProductName`, `Brand`, `Weight`, `Description`, `Stock`, `Date`, `image1`, `image2`, `Price`) VALUES
(17, 4, 'Nongshim Shin Ramyun Noodle 120g', 'Nongshim', 120, 'At the first taste of Nongshim Shin Ramyun\'s signature broth, there is no question how Shin Ramyun has become the most recognized ramyun in the world. With Shin Ramyun, you will enjoy a piping hot meal of aromatic spices, fresh vegetables and wonderfully chewy noodles in the convenience of 4 minutes.', 21, '2018-05-01', , , 1);
INSERT INTO `product` (`ProductID`, `CategoryID`, `ProductName`, `Brand`, `Weight`, `Description`, `Stock`, `Date`, `image1`, `image2`, `Price`) VALUES
(18, 6, 'Pearl River Bridge Light Soy Sauce 500ml', ' Pearl River Bridge', 500, 'Pearl River Bridge light soy sauce is the leading authentic Chinese flavour enhancer and can be used to season all types of dishes in all different cuisines, such as :-\r\n- Stir-frying: Noodles, Rice\r\n- Dipping: Spring Rolls, wonton, crispy duck\r\n- Marinating: Chicken drumsticks and wings, all other meats ', 20, '2018-05-01', , , 2);
INSERT INTO `product` (`ProductID`, `CategoryID`, `ProductName`, `Brand`, `Weight`, `Description`, `Stock`, `Date`, `image1`, `image2`, `Price`) VALUES
(19, 6, 'Preserved Black Beans in Chilli Oil', 'LaoGanMa', 280, 'A superlative variety of chilli sauce from the Chinese food brand LaoGanMa. Preserved Black Beans in Chilli Oil is available in 280g bottles which is a flavorsome blend of chilli pepper infused soybean oil and black beans preserved using salt water solution. This is a soybean based condiment in Asian cooking. Also, it goes well with dishes as an accompanying side dish.', 100, '2018-05-01', , , 2);
INSERT INTO `product` (`ProductID`, `CategoryID`, `ProductName`, `Brand`, `Weight`, `Description`, `Stock`, `Date`, `image1`, `image2`, `Price`) VALUES
(20, 6, 'Kikkoman Soy Sauce 150ml', 'Kikkoman', 150, 'Kikkoman Soy Sauce Dispenser contains 150 ml of naturally brewed soy sauce. \r\n\r\nThe Kikkoman soy sauce is made in the traditional manner using soy beans, wheat, water and salt. These are the original four pure ingredients in traditional method. The sauce is transparent, and reddish-brown in colour. Its unmistakable aroma is also one of its distinctive characteristics.  ', 20, '2018-05-01', , , 3);
INSERT INTO `product` (`ProductID`, `CategoryID`, `ProductName`, `Brand`, `Weight`, `Description`, `Stock`, `Date`, `image1`, `image2`, `Price`) VALUES
(21, 6, 'Flying Goose Sriracha Chilli Sauce Extra Coriander 455ml', 'Flying Goose', 455, 'Flying Goose Sriracha Chilli Sauce Extra Coriander is made from sun ripen chilli and finest coriander. Ready to use with roasted meat, cold meat, cutlet fish, egg roll or salad or whatever takes your fancy.', 200, '2018-05-01', , , 3);
INSERT INTO `product` (`ProductID`, `CategoryID`, `ProductName`, `Brand`, `Weight`, `Description`, `Stock`, `Date`, `image1`, `image2`, `Price`) VALUES
(22, 2, 'Zanae Squids In Hot Sauce 185g', 'Zanae ', 185, 'Mediterranean cuisine has some really wonderful seafood based dishes. The canned Squids in Hot Sauce by the Greek company Zanae is one such which follows a traditional recipe. This product is a ready seafood meal with small cleaned squids, in a chilli tomato sauce with spices.', 20, '2018-05-01', , , 3);
INSERT INTO `product` (`ProductID`, `CategoryID`, `ProductName`, `Brand`, `Weight`, `Description`, `Stock`, `Date`, `image1`, `image2`, `Price`) VALUES
(23, 2, 'Dongwon Chunk Light Tuna with Fried Black Bean Sauce 100g', 'Dong Won', 100, 'Korea', 20, '2018-05-01', , , 3);
INSERT INTO `product` (`ProductID`, `CategoryID`, `ProductName`, `Brand`, `Weight`, `Description`, `Stock`, `Date`, `image1`, `image2`, `Price`) VALUES
(24, 5, 'Fu Xing Pickled Cabbage 200g', 'Fu Xing', 200, 'The 200g can contains pickled cabbage. Fu Xing Pickled Cabbage, the traditional Chinese starter or appetizer is made from the finest and freshest cabbage in China. It\'s a moderate source of vitamin E and calcium.', 3, '2018-05-01', , , 1);
INSERT INTO `product` (`ProductID`, `CategoryID`, `ProductName`, `Brand`, `Weight`, `Description`, `Stock`, `Date`, `image1`, `image2`, `Price`) VALUES
(25, 5, 'Winter Bamboo Shoot', 'Hong Brand', 540, 'Product Overview\r\nHong Brand Winter Bamboo Shoots are made of finest and freshest bamboo shoots in China. Bamboo shoots or bamboo sprouts are the edible shoots (new bamboo culms that come out of the ground) of many bamboo species and are used in numerous Asian dishes and broths.\r\n\r\nBamboo shoots are low in Saturated Fat, and very low in Cholesterol. It is also a good source of Dietary Fiber, Protein, Riboflavin and Zinc, and a very good source of Vitamin B6, Potassium, Copper and Manganese. Bamboo shoot is notable for its tender and palatable flesh.', 34, '2018-05-02', , , 2);
INSERT INTO `product` (`ProductID`, `CategoryID`, `ProductName`, `Brand`, `Weight`, `Description`, `Stock`, `Date`, `image1`, `image2`, `Price`) VALUES
(26, 7, 'Nongshim Shrimp Flavoured Cracker Hot & Spicy 75g', 'Nongshim', 75, 'Nongshim Shrimp Flavoured Cracker Hot & Spicy ', 20, '2018-05-01', , , 1);
INSERT INTO `product` (`ProductID`, `CategoryID`, `ProductName`, `Brand`, `Weight`, `Description`, `Stock`, `Date`, `image1`, `image2`, `Price`) VALUES
(27, 7, 'Qia Qia Sunflower Seeds (Red) 308g', 'Qia Qia', 308, 'Sunflower Seeds', 20, '2018-05-01', , , 3);
INSERT INTO `product` (`ProductID`, `CategoryID`, `ProductName`, `Brand`, `Weight`, `Description`, `Stock`, `Date`, `image1`, `image2`, `Price`) VALUES
(29, 6, 'Lobo Pad Thai Sauce 280g', 'Lobo', 280, 'Among the most famous Thai dish, Pad Thai must place itself in the top five on the list. Lobo has created a delicious user-friendly recipe which makes the dish very easy to prepare, complete with roasted peanut. Lobo has created a delicious user-friendly recipe which makes the dish very easy to prepare, complete with roasted peanut and in addition, illustrates how to make the fabulous \"Fold-Over Omelet Style\". It\'s unbelievably easy and authentic.The Pack Contains; 2 sachets (1 sauce & 1 Peanuts). Pad Thai is very popular among visitors to Thailand and it has become popular all over the world. This delicious dish is so easy and quick to prepare.', 30, '2018-05-01', , , 3);
INSERT INTO `product` (`ProductID`, `CategoryID`, `ProductName`, `Brand`, `Weight`, `Description`, `Stock`, `Date`, `image1`, `image2`, `Price`) VALUES
(30, 6, 'Lobo Sukiyaki Sauce 260g', 'Lobo', 260, 'From Japan to Thailand, Sukiyaki dish gave birth to Thai-style sauce, simply called \'Sukiyaki Sauce\'. The Thai Style Sukiyaki Sauce has become so unique and popular that it brought stunning success to Sukiyaki fast food chains in Bangkok. Cook your favourite meats together with vegetables in plain soup and eat with our Sukiyaki Sauce... a real deliciousness! Store in a cool dry place.', 20, '2018-05-04', , , 3);

